package com.operator;

public class IncrDecr {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int a = 10;
int b = 6;
a++;
System.out.println(a + ++a + 5);
System.out.println(a++ + a--);
System.out.println(a+a);
System.out.println(a);
System.out.println(a - b + b-- + a);

	}

}
